char findTheDifference(string s, string t)
{
	multiset<char> mset_s(s.begin(), s.end());
	multiset<char> mset_t(t.begin(), t.end());

	set<char> result;
	multiset<char>& longer =  (mset_s.size() > mset_t.size()) ? mset_s : mset_t;
	multiset<char>& shorter = (mset_s.size() < mset_t.size()) ? mset_s : mset_t;
	std::set_difference(longer.begin(), longer.end(), shorter.begin(), shorter.end(), std::inserter(result, result.begin()));
	char diff = *(result.begin());
	return diff;
}

int firstUniqChar(string s) {

	map<char, int> mapPos2Char; 
	for_each(s.begin(), s.end(), [&mapPos2Char, &s](char ch) {
		
		auto found = mapPos2Char.find(ch);
		if (found == mapPos2Char.end())
			mapPos2Char[ch] = (int)s.find(ch);
	;});

	int minPos = s.size();
	for (const auto& record : mapPos2Char)
	{
		int counter = count(s.begin(), s.end(), record.first);
		if (counter == 1)
		{	minPos = min(minPos, record.second);}
	}
	return minPos = (minPos == s.size()) ? -1 : minPos;
}

string getHint(string secret, string guess) {

	if (secret.empty())
		return secret;

	if (guess.empty())
		return guess;

	unordered_multiset<char> msetGuess(guess.begin(), guess.end());	
	map<char, int> mapGuess;
	for (int i = 0; i < guess.length(); i++)
	{	
		auto found = msetGuess.find(guess[i]);
		if (found == msetGuess.end())
			continue;

		if (guess[i] == secret[i])
		 	mapGuess[guess[i]] = 1;
		else
			mapGuess[guess[i]] = -1;
		msetGuess.erase(guess[i]);
	}

	//clear the output string
	int bulls = 0;
	int cows = 0;
	secret.clear();
	guess.clear();
	
	for (const auto& record : mapGuess)
	{
		if (record.second == 1)
			bulls++;
		else
			cows++;
	}
	secret = to_string(bulls) + 'A';
	secret += to_string(cows) + 'B';
	return secret;
}

int findTheDistancevalue(vector<int>& arr1, vector<int>& arr2, int d) {

	if (arr1.empty())
		return 0;

	if (arr2.empty())
		return 0;

	if (d <= 0)
		return 0;

	map<int, pair<int, int>> key2Pair;
	const int SENTINEL = INT_MAX;
	//Analyze values
	for (const auto& var1 : arr1)
	{
		for (const auto& var2 : arr2)
		{
			if (var1 == var2)
				continue;

			int distance = abs(var1 - var2);
			if (distance <= d)
			{
				auto found = key2Pair.find(distance);
				if (found == key2Pair.end())
				{
					key2Pair[distance] = make_pair(var1, var2);
				}
				else
				{
					if (key2Pair[distance].first == SENTINEL)
						continue;
					key2Pair[distance].first = SENTINEL;
					key2Pair[distance].second = SENTINEL;
				}
			}
		}
	}

	for (const auto& record : key2Pair)
	{
		if (record.second.first != INT_MAX)
		{
			cout << record.first << " (" << record.second.first << " ," << record.second.second << ")" << endl;
		}
	}
	return 0;
}

void doDivisors(int num, set<int>& result)
{
	if (num == 0)
		return; 
	
	for (int i = 2; i <= num / 2; i++)
	{
		if (num % i == 0)
		{
			result.insert(i);
			doDivisors(i, result);
		}
	}
}

bool checkPerfectNumber(int num) {

	set<int> result;
	doDivisors(num, result);
	unsigned long int tmp = 0;
	for(const auto& orig : result)
		for (const auto& next : result)
		{
			if (orig != next)
			{
				tmp = orig * next;
				if (tmp < num)
					if (num % (tmp) == 0)
						result.insert(tmp);
			}
		}

	result.insert(1);
	int sum = std::accumulate(result.begin(), result.end(), 0);
	return sum == num;
}

