void eraseDuplicates(string& tmpString)
{
	auto first = tmpString.begin();
	auto second = tmpString.begin();
	
	while (first != tmpString.end())
	{
		second = first + 1;
		while (second != tmpString.end() && *first == *second)
		{	second = tmpString.erase(second);	
		};
		first++;
	};
	return;
}


