std::vector<string> Tokenize(const string str, const std::regex regex)
{
	std::vector<string> result;
	sregex_token_iterator it(str.begin(), str.end(), regex, -1);
	sregex_token_iterator reg_end;
	for (; it != reg_end; ++it) {
		if (!it->str().empty()) //token could be empty:check
			result.emplace_back(it->str());
	}
	return result;
}


int findRadius(vector<int>& houses, vector<int>& heaters) {


	if (heaters.empty())
		return INT_MAX;

	if (houses.empty())
		return 0;

	set<int> setHouses(houses.begin(), houses.end());
	set<int> setHeaters(heaters.begin(), heaters.end());
	set<int> setRadius;
	
	auto lastHeater = 0;
	for (const auto& house : setHouses)
	{
		auto largest = INT_MAX;
		for (const auto& heater : setHeaters)
		{
			if (heater < lastHeater)
				continue;

			int dist = abs(heater - house);
			if (dist == 0)
			{	largest = 0;
				break;
			}

			if (dist < largest)
			{
				lastHeater = heater;
				largest = dist;
			} else
				break;
		}
		setRadius.insert(largest);
	}
	
	
	//setHouses.clear();
	//setHeaters.clear();
	set<int>::reverse_iterator  it = setRadius.rbegin();
	int radius = *it;
	return radius;
}

