int factorial(int n)
{
	if (n == 0)
		return 1;
	return n * factorial(n - 1);
}


int numCombinations(int n, int k)
{
	if (n == 1)
		return 1;

	int result = factorial(n) / (factorial(k) * factorial(n - k));
	return result;
}

