vector<int> traverseBFS(TreeNode *root)
{	

	queue<TreeNode*> neighbors;
	vector<int> values;

	//root first
	neighbors.push(root);
	
	TreeNode *curr = root;
	while (!neighbors.empty())
	{
		//left child
		if (curr->left)
		{
			values.push_back(curr->left->val);
			neighbors.push(curr->left);
		}
		else
			values.push_back(100);

		//right child
		if (curr->right)
		{
			values.push_back(curr->right->val);
			neighbors.push(curr->right);
		}
		else
			values.push_back(100);

		//remove current node
		neighbors.pop();

		//assign new node
		if (!neighbors.empty())
			curr = neighbors.front();
	};
	return values;
}

bool analyzeTree(vector<int> values)
{
	if (values.empty())
		return false;

	int level = 1;
	deque<int> dequeTmp;
	auto it = values.begin();

	while (!values.empty())
	{

		while(!values.empty())
		{	
			dequeTmp.push_back(values.front());
			it = values.erase(it);
			if (dequeTmp.size() >= pow(2, level))
				break;			
		};

		level++;
		
		while (!dequeTmp.empty())
		{
			if (dequeTmp.front() == dequeTmp.back())
			{	dequeTmp.pop_back();
				if (!dequeTmp.empty())
					dequeTmp.pop_front();
			}
			else
				return false;
		};
	};

	return true;
}

