vector<vector<int>> flipAndInvertImage(vector<vector<int>>& A) {

	int row = A.size();
	int column = A[0].size();
	
	for (int i = 0; i < row; i++)
	{
		for (int j = 0; j < column/2; j++)
		{	swap(A[i][j], A[i][column - 1 - j]);}
	}

	for (int i = 0; i < row; i++)
	{	for (int j = 0; j < column; j++)
		{	A[i][j] = !A[i][j];}
	}

	return A;
}

bool isOneBitCharacter(vector<int>& bits) {

	if (bits.empty())
		return false;
	
	int i = 0;
	while (true)
	{	
		if (i == bits.size() - 1)
			break;

		if (i+1 > bits.size())
			break;

		if (bits[i] == 1 && (bits[i + 1] == 0 || bits[i + 1] == 1))
		{	i += 2;
			continue;
		}
		i++;
	};

	if (i == bits.size()-1 && bits[i] == 0)
		return true;
	return false;
}

