void duplicateZeros(vector<int>& arr) {

	set<int> setArr(arr.begin(), arr.end());
	if (setArr.size() == 1 && setArr.find(0) != setArr.end())
		return;

	auto it = arr.begin();
	int size = arr.size();
	while (it != arr.end())
	{
		int counter = 0;
		//count zeros
		while (it < arr.end() && *it == 0)
		{
			it++;
			counter++;
		};

		//insert zeros
		if (counter > 0)
		{	
			for (int i = 0; i < counter; i++)
			{
				it = arr.insert(it, 0);
				it++;
			}
			it--;
		}

		it++;
	};

	//delete the last elements
	if (arr.size()>size)
		do
		{
			it = arr.end() - 1;
			it = arr.erase(it);
		} while (arr.size() > size);
}

