bool isMonotonic(vector<int>& A) {

	auto it = A.begin();
	while (it < (A.end() - 1) && *it >= *(it + 1))
	{	it++;
	};
	
	if(it == (A.end() - 1))
		return (it == (A.end() - 1));

	it = A.begin();
	while (it < (A.end() - 1) && *it <= *(it + 1))
	{	it++;
	};
	return (it == (A.end() - 1));
}

