int doFirstVersion(unsigned int low, unsigned int high)
{
	unsigned int mid = (low + high) / 2;
	if (mid == low)
		return low;

	if (isBadVersion(mid))
		return doFirstVersion(low, mid-1);
	else
		return doFirstVersion(mid+1, high);
}

